const VoteScore = ({video, handleVote}) => {
    return (
      <div>
        console.log("before clicking:" + {video.raiting})
        <button onClick={() => handleVote("like")}>Up Vote</button>
        console.log("after clicking like:" + {video.raiting})
        <button onClick={() => handleVote("dislike")}>Down Vote</button>
        console.log("after clicking dislike:" + {video.raiting})
      </div>
    );
}

export default VoteScore;
